import React from 'react';
import { Link } from 'react-router-dom';
import './NavBar.css';

const NavBar = ()=>{
    return(
        <nav className='NVcontainer'>
            <div className='NVcontentTitle'>
               <Link to='/home' className='NVlink'> <h1 className='NVtitle1'>POKEMON</h1></Link>
            </div>
            <div className='NVtoolbar' ></div>    
            <ul className='NVList' >
                <li><Link to='/home' className='NVlink'>Search</Link></li>
                <li><Link to='/dashboard' className='NVlink'>Dashboard</Link></li>
                <li><Link to='/favorite' className='NVlink'>Favorite</Link></li>
            </ul>   

        </nav>
    )
}

export default NavBar;
